import React, { Component, useState, useEffect } from 'react';
import './App.css';

const get_playlists = () => fetch('/userinfo').then(res => res.json());
function App() {
  const [playlists, setPlaylists] = useState();

  useEffect(() => {
    get_playlists().then(data => setPlaylists); 
  }, []);

  return (
    <div className="App">
     <h1>Playlists</h1>
     <ul>
       {playlists && playlists.items.map(playlist => 
          <li key={ playlist.id }>{ playlist.name }</li>
        )}
     </ul>
    </div>
  );
}

export default App;
